import Typed from "typed.js";

export default function heroLogic() {
  dynamicTextOption = {
    whatAmIStrings: ["nait graduate", "coder", "dungeon master", "cat mom", "coffee addict"],
    typedOptions: {
      strings: "strings",
      typeSpeed: 50,
      backSpeed: 50,
      loop: true,
    },
  };

  const dynamicText = new Typed(".hero-h1-dynamic-text", whatAmIStrings, typedOptions);
}
